import React from "react";
import classes from "./Loader.module.css";

const Loader = () => {
  return (
    <div
      style={{ display: "flex" }}
      itemID="fountainG"
      className={[classes.fountainG, classes.fountainGM].join(" ")}
    >
      <div
        itemID="fountainG_1"
        className={[classes.fountainG, classes.fountainG_1].join(" ")}
