      />
      <div
        itemID="fountainG_3"
        className={[classes.fountainG, classes.fountainG_3].join(" ")}
      />
      <div
        itemID="fountainG_4"
        className={[classes.fountainG, classes.fountainG_4].join(" ")}
      />
      <div
        itemID="fountainG_5"
        className={[classes.fountainG, classes.fountainG_5].join(" ")}
      />
      <div
        itemID="fountainG_6"
        className={[classes.fountainG, classes.fountainG_6].join(" ")}
      />
      <div
        itemID="fountainG_7"
        className={[classes.fountainG, classes.fountainG_7].join(" ")}
      />
      <div
        itemID="fountainG_8"
        className={[classes.fountainG, classes.fountainG_8].join(" ")}
      />
    </div>
  );
};

export default Loader;
